// Resume.js
import React from 'react';

const Resume = () => {
  const containerStyles = {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  };

  const headingStyles = {
    fontSize: '24px',
    color: 'beige',
    marginBottom: '30px',
    marginLeft: '60px',
  };

  const linkStyles = {
    color: 'beige',
    textDecoration: 'none',
    marginRight: '10px',
    marginLeft: '60px',
  };

  return (
    <div style={containerStyles}>
      <h2 style={headingStyles}>Resume</h2>
      <a href="url-to-your-resume.pdf" style={linkStyles} target="_blank" rel="noopener noreferrer">
        Download Resume
      </a>
    </div>
  );
};

export default Resume;
